window.bookSummaryJSON = "<p>Will obsession be enough?</p> <p>I'd always believed my love was enough to save him. To protect him. I was wrong.</p> <p>The Copycat killer gets closer every day, and I can't help but feel his every move is in my direction.</p> <p>With dead ends around every curve and bodies piling up, it seems our time is running out.</p> <p>They took him from me. Stole the last bit of light and left him empty. Now, it's not only the Hollow Boys who are seeking revenge.</p> <p>I'm out for blood. A war path for vengeance. They wanted a villain? I'll give them one.</p> <p>Contains mature themes.</p>"; 
